import styled from 'styled-components'

export const Container = styled.div`

  button{
    width: 400px;
    margin-top: 20px;
    height: 50px;
    border-radius: 10px;
    border: 2px solid #fff;
    background-color: #FFFFFF;
    font-size: 24px;
    font-weight: bold;
    color: #069E15;
    font-style: normal;
    font-weight: bold;
  }

`
